    "multifunctional-nanostructured-metal-rubber-protective-films-for-space-exploration-project",nt"isopen":
    true,nt"url": null,nt"notes": "NanoSonic has developed revolutionary nanostructured,
    yet macroscale, multifunctional Metal Rubber&lt;SUP&gt;TM&lt;/SUP&gt; films.  In
    support of NASA's Vision for Space Exploration, low cost Metal Rubber&lt;SUP&gt;TM&lt;/SUP&gt;
    freestanding or conformal skins are being optimized as protective coatings for human
    and robotic space exploration.  Specifically, ultra-lightweight, nanostructured
    coatings with protection against electrostatic charging, abrasion and radiation
    over a wide range of mechanical and thermal fluctuations are offered.  Metal Rubber&lt;SUP&gt;TM&lt;/SUP&gt;
    is fabricated via layer-by-layer, molecular self-assembly, which enables thickness
    and placement control over multiple constituents for true nanostructured multifunctionality
    (nm scale), although advanced polymers have allowed scale-up to free-standing thick
    films (several mm thick, at less than 1 g/cc).  Metal Rubber&lt;SUP&gt;TM&lt;/SUP&gt;
    is not a conducting polymer or a sputter coated polymer film, rather a freestanding
    nanocomposite formed in situ, due to chemically reacting monolayers of nanosized
    components, eliminates residual stress between each component.  Novel, ultra-low
    modulus Metal Rubber&lt;SUP&gt;TM&lt;/SUP&gt; can be strained to &gt; 1000&#37;
    elongation while remaining electrically conductive; and returns to its original
    shape and nominal conductivity when released.  Bulk resistivity (as low as 10-5
    &amp;#937;&amp;#8729;cm), shielding (up to -70dB), and mechanical moduli (0.1 MPa
    to 500 MPa) have been demonstrated.  Metal Rubber&lt;SUP&gt;TM&lt;/SUP&gt; requires
    less than 1 vol&#37; of metal, allowing the manufacturing a cost effective, advanced
    material.",nt"license_title": "U.S. Government Work",nt"extras": [{ntt"key":
